/**
 *将百度地图转为高德地图
 */

function generateAmapPoint (pointOpt) {
  const gaodePointOpt = pointOpt
  for (let i = 0; i < pointOpt.length; i++) {
    let polyline = [...pointOpt[i].polyline[0]]
    for (let j = 0; j < polyline.length; j++) {
      polyline[j] = transfer(polyline[j])
    }
    gaodePointOpt[i].polyline = JSON.stringify(polyline)
    gaodePointOpt[i].level = 'street'
    gaodePointOpt[i].center = 'street'
  }
  return gaodePointOpt
}

function transfer (baiduPoint) {
  const x_pi = 3.14159265358979324 * 3000.0 / 180.0
  const gaodePoint = []
  let x = baiduPoint.lng - 0.0065 // lng 经度
  let y = baiduPoint.lat - 0.006 // lat 纬度
  let z = Math.sqrt(x * x + y * y) - 0.00002 * Math.sin(y * x_pi)
  let theta = Math.atan2(y, x) - 0.000003 * Math.cos(x * x_pi)
  gaodePoint[0] = z * Math.cos(theta)
  gaodePoint[1] = z * Math.sin(theta)

  return gaodePoint
}

